            url = f"https://api.telegram.org/bot{BOT_TOKEN}/sendMessage"
            payload = {"chat_id": ADMIN_ID, "text": f"üìã **ENGINE LOGS**:\n\n```\n{text}\n```", "parse_mode": "MarkdownV2"}
